import base64
from io import BytesIO
import pygame
from PIL import Image

str = b''
byte_data = base64.b64decode(str)
image_data = BytesIO(byte_data)
heliRumpfImage = Image.open(image_data)

# Konvertieren des Bildes in ein unterstütztes Format
if heliRumpfImage.mode != 'RGB':
    pil_image = heliRumpfImage.convert('RGB')
heliRumpfImage.save('temp.bmp')

# Laden des Bildes in ein Surface-Objekt
heliRumpfImage = pygame.image.load('temp.bmp').convert_alpha()